import './DetailHeader.css'
import {useStudentContext} from '../../../context/Context';

const DetailHeader = (props) => {
    const context = useStudentContext();



    return (
        <div className={'DetailHeader'}>
            <div></div>
            <button id={'Delete'}/>
        </div>
    )
}


export default DetailHeader;
